import React from "react";
import "./styles.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <footer>
      <div className="foot_container text-center">
        <Row>
          <Col>
            <h3>Paul G. Lacalle</h3>
          </Col>
          <Col>
            <h3>Contact</h3>
          </Col>
          <Col>
            <h3>George R. La Calle</h3>
          </Col>
        </Row>
        <Row>
          <h6>the street family</h6>
        </Row>
      </div>
    </footer>
  );
}

export default Footer;
